background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Google Map Integration</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">We made Google maps integration easy and hassle free and are 100% customizable.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Search by City and Country</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Now search easier &amp; get filtered results with search by City, State &amp; Country filters.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Calendar Module</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">vRent comes with advanced calendar module to set price for each date.Host &amp; admin can use the calendar by blocking the unavailable dates.Host also can set the minimum &amp; maximum dates by selecting Start date &amp; End date.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Social Signin</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Social Signin is the secure and easy way for people to log into an account. Also signing in using your Facebook or Google+ account saves time from filling all the details during signup.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Host Service Fee</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">It is nothing but the owner will get certain % of commission, once a booking is completed on the website</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Advanced Search/Filter option</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Guest can easily search the property through search/filter option. Filter option is enable to search the exact result. When you will select the check-in &amp; check-out, dates,location &amp; price range you will get the result if that time property is available.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Expandable &amp; Translation</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">vRent can translate user articles in different language. Its constantly improved its features &amp; we are going to add more and more user friendly features.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Booking by Payment</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">In vRent users have to book property by payment. User choose their desireable check-in &amp; check-out date, fill up other detail info &amp; send payment. By these way user can payment for booking.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Property Details</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Each user can see the property details info from host listing property. From property, user will be able to book each available property.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Message communication System Between Guest &amp; Host</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Guest &amp; Host can easily communicate with our message communication system by sharing their any opinion about the property.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Property Request</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Host can set the property booking as Instant booking &amp; Guest review each request.In Instant booking guest can booked instantly but in review, guest have to wait for a while to accepting the request from host.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Verification Option</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">vRent user can now verify their account with different social account like Facebook &amp; Google plus.They also can verified their E-mail address too.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Review &amp; Rating</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Reviews section show the reviews done by the user themselves on other properties and reviews given to them by other users.Guest can review and rating the Host after their stay.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Pricing Option</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">In vRent, you can done pricing in various ways. Here, Nightly pricing is for all listing. The guest who will stay long time they will get benefits as Weekly Discount percent &amp; Monthly Discount percent.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Additional Pricing</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Host also can give additional price in their listings as Weekend price, Cleaning fee, Additional guest fee &amp; Security deposit.</span></p><br><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">-In weekend pricing, host can give price to their listing on weekends</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">-Additional guest price might be applied when host need,after how many guest he want additional price.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Static Pages &amp; Metas</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">You can make static web pages content from Admin panel by your own requirements.Meta tags summarized the idea of what your site is about and what exactly the site keywords are.Meta tags are the words that are hidden in your code. People browsing your site will just not be able to see them.It brings higest site ranking quickly.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Site Settings</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">As a site owner you can set everything according to your convenience from settings option.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Sub Admin Management &amp; Privileges</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Not only a single admin, but also you can add sub admin for your site. That time you can set Role &amp; Permission for those admin from Role permission option.As a site owener you can set everything according to your convenience from settings option</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">iCalendar Integration</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">vRent supports iCalendar. iCal is a file format that allows users to create and share electronic calendars. iCal helps you keeping your calendars automatically up to date. Once you link your calendars via iCal all new reservations or blocked dates will be instantly closed out on all connected calendars. You can Import, Export &amp; Syn with other calendars.</span></p><br><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Importing enables you to have a single-calendar view of all your reservations, seasonal events, holidays and more. This will help you prevent a double booking.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Email Templates</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">We have dynamic Email templates which supports multi-language. You can change the template contents according to your needs. You can send e-mail via two protocols- SMTP &amp; Send mail, where send mail is default.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Property share option into social media</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Now, you can share your property into different social media like Facebook, Twitter &amp; Linkedin which will increase your property booking popularity. Below each property has share option to share property.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Reports</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:15pt;"><span style="font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">There are three types of Reports-</span></p><ul style="margin-bottom: 0px; padding-inline-start: 48px;"><li dir="ltr" style="list-style-type: disc; font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;" aria-level="1"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-size: 12pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Overview &amp; states</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 12pt; font-family: Arial; color: rgb(84, 84, 84); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: norm